import React from "react";
import styles from "./Footer.module.css";

const Footer = () => {
	return (
		<footer className={styles.footer}>
			<ul className={styles.ul}>
				<li>Martelo</li>
				<li>Mongui</li>
				<li>Jorge</li>
				<li>Alejandro</li>
			</ul>
		</footer>
	);
};

export default Footer;
